import React, { useState, useEffect } from 'react';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';

import { fetchExperimentData } from '../../../model/actions/experiment';
import { getExperimentsData } from '../../../model/selectors/projects';

function Experiment({ isExperimentDataLoading, experimentData }) {
    console.log(isExperimentDataLoading, experimentData);
    return (
      <p>Experiment here</p>
    );
}

Experiment.propTypes = {
    isExperimentDataLoading: PropTypes.bool,
};

export default connect(state => ({
    experimentData: getExperimentsData(state),
}), dispatch => ({
    fetchExperimentData: () => dispatch(fetchExperimentData()),
}))(Experiment);
